package day06;

public class Q12 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
//		문제12. 전체구구단 출력해 보기
		
		
		for(int i = 1 ; i <= 9 ; i++) {
			for(int n = 1 ; n <= 9 ; n++) {
				
			System.out.println(i+" x "+n+" = "+(i*n));
			}
			System.out.println("");
		
	}

}
}
